import React, { Component } from 'react'

class Home extends Component {
  render() {
    return (
      <div>
        Home
      </div>
    )
  }
}

function mapStateToProps ({ questions }) {
  return {
    questionsIds: Object.keys(questions)
  }
}

export default Home
